import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { Form, Button, Table, Card } from 'react-bootstrap';

const Lectures = ({ role }) => {
  const [courses, setCourses] = useState([]);
  const [lecturers, setLecturers] = useState([]);
  const [lectures, setLectures] = useState([]);
  const [formData, setFormData] = useState({ course_id: '', lecturer_id: '' });

  useEffect(() => {
    fetchCourses();
    fetchLecturers();
    fetchLectures();
  }, []);

  const fetchCourses = async () => {
    try {
      const res = await axios.get(`${process.env.REACT_APP_API_URL}/courses`, {
        headers: { 'x-auth-token': localStorage.getItem('token') }
      });
      setCourses(res.data);
    } catch (err) {
      console.error("Error fetching courses:", err);
    }
  };

  const fetchLecturers = async () => {
    try {
      const res = await axios.get(`${process.env.REACT_APP_API_URL}/auth/users?role=lecturer`, {
        headers: { 'x-auth-token': localStorage.getItem('token') }
      });
      setLecturers(res.data);
    } catch (err) {
      console.error("Error fetching lecturers:", err);
    }
  };

  const fetchLectures = async () => {
    try {
      const res = await axios.get(`${process.env.REACT_APP_API_URL}/lectures`, {
        headers: { 'x-auth-token': localStorage.getItem('token') }
      });
      setLectures(res.data);
    } catch (err) {
      console.error("Error fetching lectures:", err);
    }
  };

  const onChange = e => {
    setFormData({ ...formData, [e.target.name]: Number(e.target.value) });
  };

  const onSubmit = async e => {
    e.preventDefault();
    try {
      await axios.post(`${process.env.REACT_APP_API_URL}/lectures`, formData, {
        headers: { 'x-auth-token': localStorage.getItem('token') }
      });
      setFormData({ course_id: '', lecturer_id: '' });
      fetchLectures();
    } catch (err) {
      console.error("Error assigning lecture:", err.response?.data || err.message);
    }
  };

  return (
    <Card className="p-4">
      {role === 'pl' && (
        <Form onSubmit={onSubmit} className="mb-4">
          <Form.Group controlId="course_id" className="mb-3">
            <Form.Label>Course</Form.Label>
            <Form.Select name="course_id" value={formData.course_id} onChange={onChange} required>
              <option value="">Select course</option>
              {courses.map(course => (
                <option key={course.id} value={course.id}>{course.name}</option>
              ))}
            </Form.Select>
          </Form.Group>

          <Form.Group controlId="lecturer_id" className="mb-3">
            <Form.Label>Lecturer</Form.Label>
            <Form.Select name="lecturer_id" value={formData.lecturer_id} onChange={onChange} required>
              <option value="">Select lecturer</option>
              {lecturers.map(lect => (
                <option key={lect.id} value={lect.id}>{lect.username}</option>
              ))}
            </Form.Select>
          </Form.Group>

          <Button variant="primary" type="submit">Assign Lecture</Button>
        </Form>
      )}

      <h4>Assigned Lectures</h4>
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>ID</th>
            <th>Course</th>
            <th>Lecturer</th>
          </tr>
        </thead>
        <tbody>
          {lectures.map(l => (
            <tr key={l.id}>
              <td>{l.id}</td>
              <td>{l.course_name}</td>
              <td>{l.lecturer_name}</td>
            </tr>
          ))}
        </tbody>
      </Table>
    </Card>
  );
};

export default Lectures;
